import React from "react"
import { Link } from "react-router-dom"
import logo from "../assets/images/logobleu.png"
import '../assets/css/SignIn.css'
import { makeStyles } from '@material-ui/core/styles';
import Stepper from '@material-ui/core/Stepper';
import Step from '@material-ui/core/Step';
import StepLabel from '@material-ui/core/StepLabel';
import Step1 from "./Step1"
import Step2 from "./Step2"
import Step3 from "./Step3"

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
    },
    backButton: {
        marginRight: theme.spacing(1),
    },
    instructions: {
        marginTop: theme.spacing(1),
        marginBottom: theme.spacing(1),
    },
}));

function getSteps() {
    return ['', '', ''];
}

export default function Registration() {

    const classes = useStyles();
    const [activeStep, setActiveStep] = React.useState(0);
    const steps = getSteps();

    const handleNext = () => {
        setActiveStep((prevActiveStep) => prevActiveStep + 1);
    };

    return (
        <div className="loginContainer">
            <div className="login-header">
                <NavLink exact to="/" className="nav-logo">
                    <img src={logo} className="loginLogo" />
                </NavLink>
                
                <div className={classes.root}>
                    <Stepper activeStep={activeStep} connector=" " alternativeLabel>
                        {steps.map((label) => (
                            <Step key={label}>
                                <StepLabel></StepLabel>
                            </Step>
                        ))}
                    </Stepper>
                </div>
                <p className="signUpLink">Already have an account? <Link to="/login" className="here">Sign In</Link> </p>
            </div>
            {activeStep == 0 && <Step1 next={handleNext} step={activeStep} length={steps.length} />}
            {activeStep == 1 && <Step2 next={handleNext} step={activeStep} length={steps.length} />}
            {activeStep == 2 && <Step3 next={handleNext} step={activeStep} length={steps.length} />}
        </div>
    )
}
